import React from "react";
import styled from "styled-components";
import { SubTitle } from "../../../elements";

const Card = styled("div")`
width:150px;
height:150px;
position:relative;
box-shadow: 1px 1px 10px rgba(0, 0, 0, 0.161);
`;
const Container = styled("div")`
display:flex;
`;

const CenteredElement = styled("div")`
position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  font-family: Open Sans;
font-style: normal;
font-weight: bold;
font-size: 14px;
line-height: 19px;
color: #444444;
`;



const Document = () => {
    return (
        <>
            <Container>
                <div>
                    <SubTitle>Front view</SubTitle>
                    <Card>
                        <CenteredElement>
                            + Upload
            </CenteredElement>

                    </Card>
                </div>
                <div>
                    <SubTitle>Side view</SubTitle>
                    <Card>
                        <CenteredElement>
                            + Upload
            </CenteredElement>
                    </Card>
                </div>
            </Container>
        </>
    );
}



export default Document;
